- proto: PaperOffice
  entities:
  - uid: 1966
    components:
    - type: Transform
      pos: -9.823669,81.63541
      parent: 1
    - type: Paper
      content: >-
        Log 4729


        Our attempts at communication have been less than successful. Dr. Flubbernock's suggestion to offer her cookies was met with a roar that shattered half of the beakers in the lab. His solution to the ongoing destruction of lab equipment was to build a cage and transfer her to the bridge. Of course, our fearless leader considered this to be the one of the best ideas he'd ever heard. Right up there with having a 'Shower Dragon'. We've since needed to replaced all glass tables within the area.


        Anyways, the team in their infinite wisdom are now debating whether or not we may be able to communicate with her through interpretice dance.


        Yet, in this absurdity, theres a grim humor. Weve reached the pinnacle of incompetence in truly spectacular fashion.


        If we survive this, note to self: never trust Dr. Flubbernock with anything more complex than a paperclip.


        Dr. Cordellis Quipton

        Research Director
  - uid: 5423
    components:
    - type: Transform
      pos: -9.761169,81.604126
      parent: 1
    - type: Paper
      content: >-
        Log 4728


        Today marks a new low for the crew of the SS Quantum Ark. More like SS Misadventure. In a misguided attempt to test a newly invented "Quantum Cookie Jar", we inadvertently captured what appears to be an alien queen. Yes, you read the correctly.


        The genius behind this fiasco, Dr. Flubbernock, had assured us that his contraption would revolutionize snack storage. Instead, it has become a cosmic embaressment. 


        The Quantum Cookie Jar accidentally created a transdimensional rift due to a calibration error intended for infinite snack storage. This rift inadvertently targeted the precise location of the alien queen, teleporting her into the lab. As the jar hummed ominously, we watched in horror as a swirling vortex opened and deposited Her Majesty right into our lab.  Her antennae twitch with what I can only assume is a mixture of rage and disbelief.


        Despite her large stature and menacing mandibles, there's something almost comical about her presence here, hemmed in by our cluttered stacks of failed experiments. She regards us with a disdain that I imagine is reserved for the lowest of interstellar lifeformsor perhaps just us.


        Dr. Cordellis Quipton

        Research Director
